import React from "react";
import { FaTimes, FaPen, FaRegCircle } from "react-icons/fa";

const Icon = ({ name }) => {
	switch (name) {
		case "circle":
			return <FaTimes className="icons" />;
		case "cross":
			return <Fa className="icons" />;
		default:
			return <FaRegCircle className="icons" />;
	}
};

export default Icon;
